BX 319	BULBS	1	Narcissus 'Stockens Gib'	Roy Herold	Another mystery from Lt Cdr Chris M Stocken. This one came to me from a friend who received it from a grower in Belgium. It was listed by the RHS as last being commercially available in 2005. The term 'gib' was a mystery to me, and originally I thought it to be an alternate spelling of a 'jib' sail. Google told me that a 'gib' is a castrated male cat or ferret. No thanks, but it also told me that 'gib' is short for Gibraltar. Stocken also collected in the Ronda mountains of Spain, and Gibraltar is just to the south, so is the probable origin of these bulbs. As for the bulb itself, it has never bloomed for me in ~8 years, but has multiplied like crazy. It has received the summer treatment recommended for plain old 'Stockens', but to no avail. Let me know how it turns out	\N	w	\N	Narcissus
BX 319	BULBS	2	Narcissus mixed seedlings	Roy Herold	These date back to a mass sowing in 2004 of seed from moderately controlled crosses of romieuxii, cantabricus, albidus, zaianicus, and similar early blooming sorts of the bulbocodium group. Colors tend to be light yellow through cream to white, and flowers are large, much larger than the little gold colored bulbocodiums of spring. These have been selected three times, and the keepers are choice. There is the odd runt, but 95% look to be blooming size	\N	w	\N	Narcissus
