BX 402	SEEDS	8	Thunia marshalliana	Uli Urban	Thunia marshalliana is a terrestrial orchid which can be grown exactly like a geophyte. It needs a warm and sunny place in summer (I grow it in the greenhouse in hot conditions) in the open if it is warm and humid enough. Lots of water and fertilizer, the reed like plant becomes quite big. clusters of big white flowers on top of the cane. Totally dry winter dormancy. I repot every year as the roots are also dying off in winter. After the shoot has emerged in spring about 1 or 2 inches long everything is taken apart, the 2-year-old dried up pseudobulb and dead roots cut off and last year's very turgid pseudobulb with the emerging shoot is planted. Compost rich in humus with some amount of powered clay added, lots of water and fertiizer. Dry rest after the leaves start to fall. Orchid seed is for the specialist, it normally needs either the symbiosis with the fungus from the mother plant's soil to germinate or artificial lab sowing on synthetic Agar under sterile condition. I have never done this. Some Orchid seed can germinate like ordinary seed but I do not know if Thunia will do so.	\N	\N	Seed	Thunia
