BX 412	BULBS	28	Nymphaea sp.	Uli Urban	tropical blue viviparous. Forms small leaf tubers at the end of the season when the water gets cooler. These LEAF TUBERS can be stored in moist sphagnum, I treated them with a whiff of fungicide before posting, Leaf tubers are much easier to store than adult tubers. Start in spring in a heated aquarium with extra light and plant into a warm pond or large container in full sun when spring weather has warmed up, late May or early June with me. Feed with Osmocote, this does not trouble the water. I have had better results storing the adult potted tubers with almost all the foliage cut off. Stood in a large bucket in a frost free greenhouse in unheated water it made almost no growth until the days got longer and the temperature rose. Adult tubers stored in sphagnum ALWAYS rotted. Beautiful purplish-blue flowers above the water, exquisitely scented.	\N	\N	Leaf tubers	Nymphaea
