BX 419	SEEDS	9	Crinum bulbispermum 'Jumbo'	Jim Waddick	Germination: Large seeds are pushed about 1/2 way into damp sand. Germination is usually fast and total. If the seed has started to germinate orient the emerging root downwards. Add a bit of soil as it burrows down. Keep in bright light. In my cold climate I protect the first year seedlings in a frost free place and then pot them into gallon pots for their 2nd year of growth. By fall they can be planted in the garden slightly deeper than they are growing in the pot. Plant in full sun. These have proven easy and both drought and flood tolerant, and extremes of heat and cold in my Zone 5/6 garden. Expect bloom in 3 or 4 years (or more) and plant will get larger, but does not pup much. Enjoy.	\N	\N	Seeds	Crinum
