    "substring"((i.category)::text, 1, 1) AS "B/S",
    ((i.of)::text || ' of'::text) AS "Material",
    i.item AS "Item",
    i.taxon AS "Taxon",
    ((("substring"(split_part((i.donor)::text, ' '::text, 1), 1, 1) || '.'::text) || split_part((i.donor)::text, ' '::text, 2)) || split_part((i.donor)::text, ' '::text, 3)) AS donor,
        CASE i.notes
            WHEN i.of THEN ''::text
            WHEN ((i.of)::text || ' of %'::text) THEN replace(i.notes, ((i.of)::text || ' of '::text), ''::text)
            WHEN (lower((i.of)::text) || ' of %'::text) THEN replace(i.notes, (lower((i.of)::text) || ' of '::text), ''::text)
            WHEN lower((i.of)::text) THEN replace(i.notes, lower((i.of)::text), ''::text)
            ELSE "substring"(i.notes, 1, 100)
        END AS "Notes"
   FROM (bx.bx_items i
     JOIN bx.bx_dates d ON (((i.bx_id)::text = (d.bx_id)::text)))
