--
-- Name: vw_bx_date_nitems_all_nitems_seed_nitems_bulb _RETURN; Type: RULE; Schema: bx; Owner: gastil
--

CREATE OR REPLACE VIEW bx.vw_bx_date_nitems_all_nitems_seed_nitems_bulb AS
 SELECT a.bx_id,
    a.date_open,
    a.n_items AS n_items_all,
    s.n_items AS n_items_seed,
    b.n_items AS n_items_bulb
   FROM ((( SELECT d.bx_id,
            d.date_open,
            count(*) AS n_items
           FROM (bx.bx_dates d
             JOIN bx.bx_items i ON (((d.bx_id)::text = (i.bx_id)::text)))
          GROUP BY d.bx_id) a
     LEFT JOIN ( SELECT i.category,
            d.bx_id,
            d.date_open,
            count(*) AS n_items
           FROM (bx.bx_dates d
             LEFT JOIN bx.bx_items i ON (((d.bx_id)::text = (i.bx_id)::text)))
          WHERE (i.category ~~ 'SEEDS'::text)
          GROUP BY d.bx_id, d.date_open, i.category) s ON (((a.bx_id)::text = (s.bx_id)::text)))
     LEFT JOIN ( SELECT i.category,
            d.bx_id,
            d.date_open,
            count(*) AS n_items
           FROM (bx.bx_dates d
             LEFT JOIN bx.bx_items i ON (((d.bx_id)::text = (i.bx_id)::text)))
          WHERE (i.category ~~ 'BULBS'::text)
          GROUP BY d.bx_id, d.date_open, i.category) b ON (((a.bx_id)::text = (b.bx_id)::text)))
  ORDER BY a.bx_id;


